const VaccinationSearcher = () => {
    return ( 
        <div className="search">
            <h2>Wprowadź nazwę miasta oraz datę szczepienia</h2>
            <form onSubmit={handleSubmit}>
                <label>Miasto:</label>
                <input type="text" required value={title} onChange={(e) =>setTitle(e.target.value)}/>
                <label>Blog body:</label>
                <textarea  required value={body} onChange={(e) => setBody(e.target.value)}></textarea>
                <label>Blog author:</label>
                <select
          value={author}
          onChange={(e) => setAuthor(e.target.value)}
        >
          <option value="Wiktor" style={{color:'black'}}>Wiktor</option>
          <option value="Sebastian" style={{color:'black'}}>Sebastian</option>
          <option value="Ela" style={{color:'black'}}>Ela</option>
          <option value="Slawomir" style={{color:'black'}}>Sławomir</option>
          <option value="Bogdan" style={{color:'black'}}>Bogdan</option>
        </select>
        {!isPending &&<button>Add Blog</button>}
        {isPending &&<button disabled>Adding Blog..</button>}
      </form>
        </div>
     );
}
 
export default VaccinationSearcher;
